import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Average(){
    return(
    <div>
        <h1>Kalkulator średniego spalania na 100 km</h1>
        <div>Spalone paliwo w litrach: <input type="number" name="fuel"/></div>
        <div>Ilość przejechanych kilometrów: <input type="number" name="km"/></div>
        <div>Cena litra paliwa (opcjonalne): <input type="number" name="cost"/></div>
        <button>Oblicz</button>
    </div>
    ); 
}

function Cost(){
    return(
    <div>
        <h1>Kalkulator kosztu przejechania trasy</h1>
        <div>Długość planowanej trasy w kilometrach: <input type="number" name="km"/></div>
        <div>Średnie spalanie w litrach na 100 km: <input type="number" name="fuel"/></div>
        <div>Cena litra paliwa: <input type="number" name="cost"/></div>
        <button>Oblicz</button>
        <Average />
    </div>
    ); 

}


ReactDOM.render(<Cost />, document.getElementById('root'));
